      "title": "Personalized Cards, Pregnancy Announcements & more!",
      "announcement": "CURRENT TURNAROUND TIMES:   Greeting Cards - (USA) are shipping out in about 1-3 business days.   Please allow 4-10 days for standard First Class Mail to arrive once shipped (Priority Mail upgrades available at checkout)\r\n\r\n*****************\r\n\r\nInternational Orders - Most orders have been arriving in about 10-16 days (but please allow up to 30 days for arrival).\r\n\r\n***ENJOY 15% off your order!  At checkout use coupon code:  SUMMER",
      "currency_code": "USD",
      "is_vacation": false,
      "vacation_message": "\u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606  \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \r\n\r\n\u2606 Lasting Moments is currently on a break for the holidays.  All existing orders have been shipped!\r\n\r\n\u2606 Please check your email for your shipping confirmation with your tracking number or go under &quot;You &gt; Purchases&quot; on the Etsy website or app and your tracking number is attached to your order receipt.\r\n\r\n\u2606 If you need help tracking your package please contact the United States Postal Service at:\r\nhttps:\/\/www.usps.com\/help\/contact-us.htm\r\nor 1-800-ASK-USPS\u00ae (800-275-8777)\r\n\r\n\u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \u2606  \u2606 \u2606 \u2606 \u2606 \u2606 \u2606 \r\n",
