      "accepts_custom_requests": true,
      "policy_welcome": "Welcome to Lasting Moments Design. :)",
      "policy_payment": "SECURE OPTIONS\nEtsy keeps your payment information secure. Sellers don't receive your credit card information.\n- Visa\n- MasterCard\n- American Express\n- Discover\n- PayPal\n- Apple Pay\n- SOFORT Bank Transfer\n- iDEAL\n- Etsy Gift Card",
      "policy_shipping": "PROCESSING TIME\nThe time I need to prepare an order for shipping varies. For details, see individual items.\n\nESTIMATED SHIPPING TIME\nCanada: 6 - 28 business days\nUnited States: 4 - 10 business days\nEurope: 7 - 28 business days\nAustralia, New Zealand and Oceania: 10 - 28 business days\n\nI'll do my best to meet these shipping estimates, but cannot guarantee them. Actual delivery time will depend on the shipping method you choose.\n\nCUSTOMS AND DUTIES FEES\nBuyers are responsible for any customs or duties fees that may apply. Sellers aren't responsible for delays due to customs",
      "policy_refunds": "I GLADLY ACCEPT CANCELLATIONS\nRequest a cancellation within: 12 hours of purchase\n\nI DON'T ACCEPT RETURNS OR EXCHANGES\nBut please contact me if you have any problems with your order.",
      "policy_additional": "I will only use your shipping and billing address, and contact information\n- To communicate with you about your order\n- To fulfill your order\n\nSHIPPING ESTIMATES - USA\n\u2022 Standard shipping - please allow 4-10 days for delivery\n\u2022 Priority Mail - please allow 2-4 days for delivery\n\n*Orders of 7+ cards will be shipped via Priority Mail no upgrade needed\n**Delivery times are estimated and not guaranteed. For holiday cards and card orders with a specific need by date, PLEASE order early. If your need by date is less then 10 days away.. upgrading to Priority Mail is advised.\n\nSHIPPING ESTIMATES - INTERNATIONAL (OUTSIDE OF THE USA)\nPlease allow 6-30 days for delivery.  Most orders have been arriving in about 10-14 days (but please allow up to 30 days for arrival).\n\nShipping times vary and are not guaranteed. *International customers are responsible for all custom fees, taxes, import fees, etc. issued by your country\/postal service\n\nCURRENT TURNAROUND TIMES\nCURRENT TURNAROUND TIMES: Greeting Cards - (USA) are shipping out in about 1-2 business days. Please allow 4-10 days for standard First Class Mail to arrive once shipped (Priority Mail upgrades available at checkout)\n\n*****************\n\nInternational Orders - Most orders have been arriving in about 10-16 days (but please allow up to 30 days for arrival).\n\nREFUNDS & EXCHANGES\nDue to the custom and personalized nature of our products we do NOT offer refunds or exchanges.\n\nWe do not offer refunds on cards that are delivered after their need by date. We suggest ordering cards at least 10 days prior to holidays or events as unforeseen delays with the postal service can occur.\n\nPLEASE double check your shipping address. We cannot replace or refund items that are delivered to old or incorrectly entered addresses.\n\nDIGITAL GREETING CARD FILES\nUnfortunately, at this time we do NOT offer digital versions of our fold over greeting cards.\n\nSHIPPING DIRECTLY TO YOUR RECIPIENT?\nNo problem! Please include your recipient&#39;s address on the ship to section of the checkout screen. Please ALSO leave a note in the &quot;Notes to DesignsLM&quot; box that you want your card directly shipped and include any special messages, to\/from names you&#39;d like printed inside. And we&#39;ll gladly send your card directly in the envelope with no packing material.\n\nCUSTOM AND PERSONALIZED ORDERS\nAll cards are made to order. Text and wording can be changed to your specifications. (Want your card to say Daddy instead of Dad, Grammy instead of Grandma? No problem!) Please include any special instructions, notes, or custom text in the &quot;Notes to DesignsLM&quot; box at checkout.\n\nGRAPHIC CREDIT\nSome graphics used in our designs are created by Prettygrafik Design, ClipArtopia, Cocomint, Emily Reece Designs, Pixel Paper Prints, Revidevi, grafos, Cutesiness, IcemiloClipart, CeliaLauDesigns, funkymushrooms, goodnessandfun, PPbNDesigns, DorkyPrints, ErinBradleyDesigns, DigitalBakeShop, DreamlikeMagic, peachpopsclipart, MareeTruelove, SonyaDeHartDesign, KlouiseDigiArt, AMBillustrations, SandyDigitalArt, Cherryclipart, Zenware Designs or JW Illustrations.\n\n\n*Please note that colors may differ slightly on screen than your final printed pieces depending on the computer or electronic device it&#39;s being viewed on.*",
