      "accepts_custom_requests": true,
      "policy_welcome": "Welcome!!\r\n\r\nHere at the Creative Red Barn, we believe in finding and getting back to our roots, therefore we strive to offer only the best. We use only the best certified organic ingredients when crafting our products. When we can&#39;t find organic, we wild-craft, meaning we gather ingredients where we know they haven&#39;t been compromised by pesticides, unsustainable farming practices, or other harmful chemicals. \r\n\r\nWe pride ourselves in the fact that there are absolutely NO pre-made bases here. We measure, test, sample and hand pour each and every one of our products. All of the containers and tins we use are re-usable and recyclable. We are Earth Conscious, in that we recycle here at our home, and compost paper and card board materials. We encourage our customers to do the same. \r\n\r\nWe are homesteaders, practicing organic gardening and farming. We shop local to support our farmers. We are a husband and wife team, guiding and supporting each other in this endeavor. \r\n\r\nIf there is something you don&#39;t see here, that you would like us to create for you, please drop us a message!\r\n\r\n",
      "policy_payment": "SECURE OPTIONS\nEtsy keeps your payment information secure. Sellers don't receive your credit card information.\n- Visa\n- MasterCard\n- American Express\n- Discover\n- PayPal\n- Apple Pay\n- SOFORT Bank Transfer\n- iDEAL\n- Etsy Gift Card",
      "policy_shipping": "PROCESSING TIME\nThe time I need to prepare an order for shipping varies. For details, see individual items.\n\nESTIMATED SHIPPING TIME\nNorth America: 3 - 7 business days\nEurope: 1 - 5 weeks\nAustralia, New Zealand and Oceania: 3 - 5 weeks\n\nI'll do my best to meet these shipping estimates, but cannot guarantee them. Actual delivery time will depend on the shipping method you choose.\n\nCUSTOMS AND DUTIES FEES\nBuyers are responsible for any customs or duties fees that may apply. Sellers aren't responsible for delays due to customs",
      "policy_refunds": "I GLADLY ACCEPT CANCELLATIONS\nRequest a cancellation within: 24 hours of purchase\n\nI DON'T ACCEPT RETURNS OR EXCHANGES\nBut please contact me if you have any problems with your order.",
      "policy_additional": "I will only use your shipping and billing address, and contact information\n- To communicate with you about your order\n- To fulfill your order\n- For legal reasons (like paying taxes)\n\nGIFT WRAPPING AND PACKAGING\nAvailable! Just ask!\n\nWHEN DOES MY ORDER SHIP?\nIf your order was directly off of my shop inventory, then your order will ship NEXT business day. So if you order on Friday, you&#39;re order will ship MONDAY. If you order the day BEFORE or ON a HOLIDAY, your order will ship the next working business day. \n\nIf you had a CUSTOM order, your order will ship when the order is completed.\n\nMY ORDER WAS CUSTOM, HOW LONG DOES IT TAKE TO MAKE AND TO SHIP?\nIf your order was a custom order, please allow 5-10 business days for order completion and an additional 3-7 days for shipment.\n\nWHY DO YOU NOT ACCEPT RETURNS?\nWe do not accept returns because of the nature of the products we offer. Our products are to be used on the body, and we need to take precautions. \n\nIf you have any trouble or complaints about your purchase, please contact us directly to solve any issues you may have.\n\nWHY MUST I CANCEL MY ORDER WITHIN 24 HOURS OF ORDERING?\nBecause we ship next business day, we need to know RIGHT AWAY if you need to cancel your order. Once your order has shipped, we will not cancel it.\n\nIF I DON&#39;T LIKE MY ITEMS, DO YOU REFUND?\nAt this time, we do not issue refunds. Due to the nature of our products (they are to be used on the body and in in the bath), we can not refund your purchase. We ask that you purchase with awareness. If you have ANY questions, please send us a message at ANY time, we will reply with in 24 hours.\n\nMY ITEM WAS DAMAGED DURING SHIPPING, WHAT DO I DO?\nIf your item was damaged during shipment, we ask that you IMMEDIATELY send us a message with photos so we can correct the issue. If we deem that the mail system damaged the package, then we will promptly send you new product. If damage is caused by the customer, a replacement will NOT be sent.\n\nCARE INSTRUCTIONS\nMost of our products are to be used with 1-2 years, and are to only be used EXTERNALLY. None of our products are tested by the FDA, and the user is using our products at his or her discretion. \n\nKeep products out of extreme heat.\n\nWHOLESALE AVAILABILITY\nWholesale and bulk orders are available. Please send a message for a quote, as each wholesale or bulk order is priced case by case.",
