      "announcement": "** 5-DAY FATHERS DAY SALE!! **\nCelebrate your pops by sending him a unique Goodie Two Sleeves t-shirt.  \nSAVE 30% off your order by using coupon code: DAD30 at checkout. \nSale ends at midnight on 6\/20\/16  ~HAPPY DADS DAY TO YOU ALL~",
