      "vacation_message": "We apologize for the delay but will be closed for year-end inventory from December 31st-January 10th. All orders received now until January 11th will be placed on hold and processed on January 11th. We thank you for your understanding and patience. Goodie Two Sleeves wishes you all a very happy New Year!!",
      "sale_message": "Thank you for your order! Our magical T-Shirt Unicorns are already hard at work pulling and packing your order full of t-shirty goodness! If you have any questions or comments, feel free to contact us.\r\n \r\n We wish you all a very Happy New Year!! \r\nGoodie Two Sleeves",
