      "accepts_custom_requests": false,
      "policy_welcome": "We make clean funny t-shirts you can&#39;t find anywhere else! We&#39;ll help you find top quality humor tees for the whole family.\r\n\r\nOur ideas are original & hilarious. Our designs are beautifully drawn. Our t-shirts are buttery soft. Our printing has a &#39;No-Feel&#39; feel. Each order comes with free goodies (buttons, stickers, etc.). Plus, every package is sealed with a unicorn kiss!\r\n\r\nOur prices are affordable and help our families pay our mouths and feed our bills... or something.",
      "policy_payment": "SECURE OPTIONS\nEtsy keeps your payment information secure. Sellers don't receive your credit card information.\n- Visa\n- MasterCard\n- American Express\n- Discover\n- PayPal\n- Apple Pay\n- SOFORT Bank Transfer\n- iDEAL\n- Etsy Gift Card",
      "policy_shipping": "PROCESSING TIME\nThe time I need to prepare an order for shipping varies. For details, see individual items.\n\nESTIMATED SHIPPING TIME\nAustralia: 1 - 2 weeks\nCanada: 4 - 7 business days\nNorth America: 3 - 5 business days\nEurope: 1 - 2 weeks\n\nI'll do my best to meet these shipping estimates, but cannot guarantee them. Actual delivery time will depend on the shipping method you choose.\n\nCUSTOMS AND DUTIES FEES\nBuyers are responsible for any customs or duties fees that may apply. Sellers aren't responsible for delays due to customs",
      "policy_refunds": "I GLADLY ACCEPT RETURNS, EXCHANGES, AND CANCELLATIONS\nJust contact me within: 14 days of delivery\nShip returns back to me within: 30 days of delivery\nRequest a cancellation within: 12 hours of purchase\n\nTHE FOLLOWING ITEMS CAN'T BE RETURNED\nBecause of the nature of these items, unless they arrive damaged or defective, I can't accept returns for:\n- Items on sale\n\nCONDITIONS OF RETURN\nBuyers are responsible for return shipping costs.\nIf the item is not returned in its original condition, the buyer is responsible for any loss in value.\n\nQUESTIONS ABOUT YOUR ORDER?\nPlease contact me if you have any problems with your order.",
      "policy_additional": "I will only use your shipping and billing address, and contact information\n- To communicate with you about your order\n- To fulfill your order\n- For legal reasons (like paying taxes)\n\nCAN I GET A DRAWING ON THE BOX?\nMaybe! We cannot guarantee that any request will be fulfilled. It is not an official service we offer, but if we receive a special request we try to fulfill it. Drawing-with-the-box requests may add up to 2 weeks to the processing time. We cannot make any guarantees that your request will be fulfilled, or regarding the quality of requests.\n\nWHAT SIZE SHOULD I ORDER?\nCheck out our Sizing Chart to see what size will work best. We recommend grabbing your favorite, best fitting shirt out of your closet and measuring it to see which of our sizes will feel the best. Please remember, cotton shrinks a bit. Wash all of your clothes in cold water and tumble dry with no heat to minimize shrinkage.\n\nCAN I RETURN OR EXCHANGE SOMETHING?\nYes! We have a 30 satisfaction guarantee and we want you to be totally satisfied with your order. Visit the returns page for details on how to exchange or return an item.\n\nWHOLESALE AVAILABILITY\nWe offer a massive variety of tees and accessories for wholesale. Please contact us and a customer service agent will contact you right away.\n\nDO YOU CARRY &QUOT;SIZE\/COLOR\/STYLE&QUOT; ONLINE?\nChances are if you cannot find a style, size, or color online it is no longer available. However, please email us to see if we currently have what you are looking for. Not all of the items we sell are available online so there&#39;s always a chance!",
