    "description": "Original acrylic painting PRINT: &quot;Rainbow Farts Unicorn&quot;. Show your home a little bit of love with a beautiful piece of art! This unicorn was born with purple hair, a red heart shaped birthmark, and she is so magical she farts rainbows! She is fun and sassy so she always wears her white pearl necklace, red lipstick and matching red bow. Artwork is featured on a digital watercolor background. \n\nWhen you purchase this art, I will donate 10% of the sale to help feed somebody in need through local charities - Yay! :)\n\nDetails:\n-Listing is for signed art print only, frame not included. \n-Print will be signed on the front by artist.\n-Printed on professional grade photo paper in sizes that are easy to frame. Choose your size print from the drop down menu (to the right of the photo) available sizes: 4x6&quot;, 5x7&quot;, 8x10&quot;. \n-Watermark of website will not be on the print you purchase. \n-Looks great in any room and suitable for all ages.\n-Gift ready packaging: re-sealable archival crystal clear bag with protective cardboard backing.\n-Shipped safely in a protective non bending rigid mailer.\n-Colors may vary slightly from your computer screen.\n-Cropping may vary slightly once printed depending on the size ordered but will not affect the integrity of the artwork.\n\nThank you for your interest and happy shopping! :)\nPeace to you and yours.\n\nAll rights reserved \u00a9 Rainbow Farts Art.",
