      "announcement": "Hi!  I hope my art offerings make you smile.  Want an extra reason to smile?  I will donate 10% of each sale to various charities (currently donations are helping feed those in need).  All my goodies are made with love and I adore sharing what I&#39;ve created with others.  It makes my day when someone connects with something I&#39;ve made and gives it a happy new home.  Please enjoy your visit to my site and be sure to add me on your social media sites and\/or bookmark this site so you can come back in the future.  Have a magical day!!  xoxo -Susan\r\n\r\nMy current offerings are things like acrylic paintings on canvas, wood, and reclaimed items, signed art prints, apparel, stickers, and coffee mugs.  New items are being added to my shop regularly, be sure to check back often.  I often make only one original piece and I regularly retire certain items\/series so be sure to get that piece you have your eye on now before it&#39;s gone!\r\n\r\nMy art is great for any room in the house and in most cases all ages.  Among my collections you will find magical unicorn creatures farting rainbows (of course!), mommy art, nursery art, equality themes, children&#39;s room art, bathroom d\u00e9cor, inspirational pieces, folk art, abstract art, cartoon works, fun quotes, sweet apparel, hilarious stickers, and more!  My goal is to create pieces that makes others happy.\r\n\r\nFor updates on sales, giveaways, new artwork, inspirations and more connect with me on your favorite social media outlet! \r\nhttps:\/\/www.rainbowfartsart.com\r\nhttp:\/\/www.instagram.com\/rainbowfartsart\r\nhttps:\/\/www.facebook.com\/rainbowfartsart\r\nhttps:\/\/www.twitter.com\/RainbowFartsArt\r\nhttps:\/\/www.tumblr.com\/blog\/rainbowfartsart\r\n\r\nPlease message or email me with any questions - I LOVE hearing from you :)  Thank you for stopping by!  \r\n\r\nLots of love,\r\nSuzy Q, The Rainbow Farts Unicorn\r\nrainbowfartsart@gmail.com",
      "currency_code": "USD",
      "is_vacation": false,
      "vacation_message": "Hi guys!  I&#39;m in the middle of moving and am taking a small break from running my shop during the moving process, but have no fear, the shop will be back up and running once I&#39;m all settled in :)",
      "sale_message": "THANK YOU for your purchase!  \r\nWant a couple of reasons to smile?  Did you know that in addition to buying something radical, you are also helping support an independent artist\/work at home mom with your purchase?  I will also donate 10% of your purchase price to a local charity to help feed those in need.  Yay!! :)\r\n\r\nI will ship your item 1-5 days after I receive payment (please allow up to 2 weeks for custom orders).  Packages are shipped to the address provided by your Etsy account unless otherwise specified.\r\n \r\nThanks again & I hope you love your new goodies! \r\nSuzy Q, The Rainbow Farts Unicorn\r\n\r\nFor updates on giveaways, sales, new artwork, inspirations and more connect with me on your favorite social media outlet! \r\nhttp:\/\/www.instagram.com\/rainbowfartsart\r\nhttps:\/\/www.facebook.com\/rainbowfartsart\r\nhttps:\/\/www.twitter.com\/RainbowFartsArt\r\nhttps:\/\/www.tumblr.com\/blog\/rainbowfartsart",
