      "login_name": "alterednation",
      "accepts_custom_requests": false,
      "policy_welcome": "Welcome to Rainbow Farts Art!  I am happy you stopped by and hope you find something fun to add to your art collection and\/or give as a gift!  For every purchase made in my shop, I will donate 10% of the sale to help feed somebody in need through local charities - yay! :)  Rainbow Farts offers a fun spirited collection of artwork for fun spirited people.  Please let me know if you have any questions.  For updates on sales, giveaways, new artwork, inspirations and more connect with me on your favorite social media outlet! \r\nwww.facebook.com\/rainbowfartsart\r\nwww.instagram.com\/rainbowfartsart\r\nwww.twitter.com\/RainbowFartsArt\r\nwww.tumblr.com\/blog\/rainbowfartsart\r\n\r\nPeace & Love!\r\n-Suzy Q, (The Rainbow Farts Unicorn)",
      "policy_payment": "I accept all major credit and debit cards through Etsy and Paypal (you do not need a Paypal account to pay with Paypal).  I also accept Etsy Gift Cards.  I will always wait for payments to clear before shipping your purchase.",
      "policy_shipping": "I ship worldwide (hooray!) \r\nI will ship your item in 1-5 business days after payment goes through.\r\nIf your item is a custom order please allow for up to 2 weeks to create your unique artwork.\r\n\r\nHow will your item be shipped?\r\nI ship via USPS and use a variety of their shipping methods based on the size\/weight of your order.  Here are some details about the shipping methods I use:\r\n*USPS first class (takes 1-3 business days)\r\n*USPS Priority mail (includes tracking #, takes 1-3 business days)\r\n*USPS Standard Post\/Parcel Select (includes tracking #, takes 2-8 business days).  \r\n\r\nYour art will be signed, and packed safely for a happy delivery.  All items will be shipped with love and care within 1-5 business days after payment has been made.  I utilize new and recycled materials to assure your goodies arrive safely.  All art prints are packaged professionally, are gift ready, and sent in non bending rigid mailers.  Larger art items are wrapped carefully with tissue paper, magazine\/newspaper stuffing and\/or bubble wrap to assure a safe arrival.  \r\n\r\nIf you would like to purchase expedited shipping, insurance, gift wrapping, or any other extras for your package please let me know so I can get you a quote.  In addition if you send me a private message at checkout I can ship the item directly to your gift recipient (no receipts\/invoices will be included so they will not see the cost etc.) - there is no extra charge for this service.",
      "policy_refunds": "I always want my customers to be happy so if you are unhappy for any reason just contact me as soon as you receive your shipment and we can figure out a solution.  Shipping fees are non-refundable.",
