      "creation_tsz": 1369760973,
      "title": null,
      "announcement": "Thank you for visiting Turbothreads Etsy!\r\nWelcome to 2016\r\nI hope you enjoy all the new items I will be gradually adding to my shop in the next month!\r\n\r\nStay warm!\r\n\r\nLove to you and Your houndies\r\nStay Warm!\r\nTurbothreads.",
      "currency_code": "USD",
      "is_vacation": false,
      "vacation_message": "Thanks for Visiting The Turbothreads Etsy!\r\n\r\nI had opened for a Short time during the Howl-I-Day for a few custom orders!\r\nAs of right now have filled all my spots for custom orders and my shop will Re-Open January 2nd with a special FREE Domestic shipping coupon code! &quot;HappyNewYear2016&quot;\r\n\r\nThe Turbothreads Family wishes everyone a Safe, Happy and Prosperous New Year!\r\n\r\nLots of Love\r\nTurbothreads!\r\n\r\nTo see turn around times, News, New items that will be in my shop when i return please visit my Facebook @  www.Facebook.com\/Turbothreads or Instagram @Turbo_Threads\r\n\r\nFor any questions regarding an item Please feel free to email me @ AGTurbothreads@gmail.com and i will promptly respond!\r\n\r\nThank you so much for your patience during this very busy time\r\n-Adrianna & Turbo\r\n",
      "sale_message": "**Important!**\r\nDearest Buyer! \r\n\r\nTo ensure you get your order without delay please include proper measurements for that item. (Including Doggaroos, Collars, and belly bands)\r\n\r\nFirst and Foremost thank you for choosing my shop for your Doggy items! Now that you have ordered your items there is some things you may need to know! It is now Fall and Winter! Your item may take about 2-3 weeks from your order date to ship. To get priority shipping please contact me. If you need your item sooner please contact me so we can set up a Rush order!\r\n\r\nIf you fail to provide your required measurements I will attempt to email you 3 times to get these measurements. 5 days after my last attempt if you have made COMPLETE FAILURE to mail me this information YOUR ORDER WILL BE CANCELED! :(\r\nI dont wanna do that so please make sure you include your measurements :D\r\n\r\nThank you for ordering Handmade items from TurboThreads! \r\nYour business is much appreciated!\r\n\r\n-Adrianna&Turbo\r\nTurbothreads\r\n\r\n",
