      "last_updated_tsz": 1466627452,
      "listing_active_count": 55,
      "digital_listing_count": 0,
      "login_name": "Addriiannaa",
      "accepts_custom_requests": true,
      "policy_welcome": "Welcome to TurboThreads Etsy Page!\r\nMy focus is items for Italian Greyhounds and small dogs! BUT that doesn&#39;t limit my business outside of  sighthound breed as I am open to making items for any breed of dog! Here at Turbothreads we are here to provide you with Secure, Functional, and stunning handmade items that will surely accentuate the beauty of your pets.\r\n\r\n*All items made in a Air filtered environment.*\r\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\nPlease feel free to contact me here on Etsy or email me at AGTurboThreads@gmail.com. I do check both daily and will reply to any questions you may have as soon as possible (Usually between 24-48 hours)\r\n\r\nThank you!",
      "policy_payment": "I accept payment through Paypal. Although I accept payment through paypal you may purchase using any debit card, credit card, or e-check.\r\n\r\nAny order with a &quot;deadline&quot; or specified date of arrival (AKA: RUSH ORDER) there will be an extra 20% charge as well as a charge for Priority shipping.\r\n\r\n",
      "policy_shipping": "-All orders get sent with USPS First Class Mail. If you would like priority for expedited shipping this is available with an extra charge. Please send me a message so this can be arranged.\r\n\r\n-All orders get sent to the Post Office within 2-14 days from initial order (unless specified otherwise)\r\n\r\n-Please, make sure your address on Paypal is the address you would like your item shipped to!\r\n\r\n-INTERNATIONAL SHIPPING IS AVAILABLE. Since price of shipping to different countries wavers please message me and I will get a shipping quote for you!",
      "policy_refunds": "***All orders are made based off your pups measurements\r\nIf your measurement is correct it WILL fit\r\n\r\nAll of Turbothreads Items are measured a minimum of 3x. Before, during, and after assembly.\r\nPlease be as accurate as possible when measuring your pet.**\r\n\r\n- If you have made a mistake in your measurements when you receive your item i am more then happy to do an alteration to, which will be altered same day i receive it.\r\n\r\n-Items may change slightly over time, please read descriptions carefully prior to ordering as there is no refunds\/returns on custom-made pet wear.\r\n\r\n-Absolutely no refunds or exchanges on custom made pet clothing. \r\nAgain, MEASURE ACCURATELY.\r\n\r\n-Please inspect collars on a regular basis for wear\r\nAlthough I make each collar as strong as possible for your pets safety, wear can happen over a long period of time\r\n\r\n-Order may not be canceled after 24 hours.\r\n\r\n-All sales are final, No returns.",
      "policy_additional": "\r\n-Measurements are REQUIRED for me to complete your order on Collars, Doggaroos, Belly Bands and Snoods. Failure to provide these measurements at the time your order is made will delay your order. \r\n\r\n-I will attempt to email you 3 times to get these measurements, 5 days after my last attempt if you have made COMPLETE FAILURE to mail me this information YOUR ORDER WILL BE CANCELED!\r\n\r\n",
