      "announcement": "See our sold items here: https:\/\/www.etsy.com\/shop\/DrageynDesigns\/sold - Thanks for stopping by Drageyn Designs. The name came from a creative flip of our family&#39;s last name. We are a wife and husband team with three amazing kids, and our designs are professionally created in our home studio.  At this time we offer custom designed coffee mugs \/ coffee cups \/ travel mugs that range from sweet, funny, sarcastic, to seriously not afraid to show a little teeth. We try to be very clear in our policies and listings, but if you have any questions just send us a conversation - we are always happy to help or discuss custom possibilities as well. :)",
