      "policy_welcome": "Thanks for stopping by Drageyn Designs. The name came from a creative flip of our family&#39;s last name. We are a wife and husband team with three amazing kids, and our designs are professionally created in our home studio.  At this time we offer custom designed coffee mugs \/ coffee cups that range from sweet, funny, sarcastic, to seriously not afraid to show a little teeth. We try to be very clear in our policies and listings, but if you have any questions just send us a conversation - we are always happy to help or discuss custom possibilities as well. :)",
      "policy_payment": "SECURE OPTIONS\nEtsy keeps your payment information secure. Sellers don't receive your credit card information.\n- Visa\n- MasterCard\n- American Express\n- Discover\n- PayPal\n- Apple Pay\n- SOFORT Bank Transfer\n- iDEAL\n- Etsy Gift Card",
      "policy_shipping": "PROCESSING TIME\nThe time I need to prepare an order for shipping varies. For details, see individual items.\n\nESTIMATED SHIPPING TIME\nCanada: 1 - 2 weeks\nMexico: 1 - 4 weeks\nUnited Kingdom: 2 - 6 weeks\nUnited States: 2 - 3 business days\nEurope: 2 - 6 weeks\nAustralia, New Zealand and Oceania: 2 - 6 weeks\n\nI'll do my best to meet these shipping estimates, but cannot guarantee them. Actual delivery time will depend on the shipping method you choose.\n\nCUSTOMS AND DUTIES FEES\nBuyers are responsible for any customs or duties fees that may apply. Sellers aren't responsible for delays due to customs",
      "policy_refunds": "I GLADLY ACCEPT RETURNS\nJust contact me within: 3 days of delivery\nShip returns back to me within: 7 days of delivery\n\nI DON'T ACCEPT EXCHANGES OR CANCELLATIONS\nBut please contact me if you have any problems with your order.\n\nTHE FOLLOWING ITEMS CAN'T BE RETURNED\nBecause of the nature of these items, unless they arrive damaged or defective, I can't accept returns for:\n- Custom or personalized orders\n- Perishable products (like food or flowers)\n- Digital downloads\n- Intimate items (for health\/hygiene reasons)\n- Items on sale\n\nCONDITIONS OF RETURN\nBuyers are responsible for return shipping costs.\nIf the item is not returned in its original condition, the buyer is responsible for any loss in value.",
      "policy_additional": "I will only use your shipping and billing address, and contact information\n- To communicate with you about your order\n- To fulfill your order\n- For legal reasons (like paying taxes)\n\nWHITE CERAMIC MUGS - CARE\nWhite ceramic mugs are dishwasher safe with non bleach cleaners. Although, Dishwasher cleaner can be abrasive and hand washing is always the ideal choice.\n\nSTAINLESS STEEL AND ALUMINUM DRINKWARE - CARE\nThese items are metallic they should not be microwaved. Hand wash with non bleach cleaners only. Using a dishwasher can damage the finish on these items. These instructions are for white coated items that are metallic stainless steel or aluminum items as well.\n\nCUSTOM AND PERSONALIZED ORDERS\nI welcome custom orders, there is rarely a request I can&#39;t complete. Please contact me to discuss options and pricing.\n\nAll orders for custom work must be paid in advance of any design or processing. At no additional costs I will allow changes as needed, to allow you to input on a finalized product you can be happy with!\n\nPlease double check any word spellings, and the personalization details before submitting your order. I try to check for common misspellings but cannot be responsible for mistakes provided with an order, and for names which can have various spellings.\n\nINTERNATIONAL ORDERS\nDepending on your country it can take between 2-6 weeks for your items to arrive. The time frame is dependent on the carrier service and how quickly the order clears any customs for your country.\n\nCOLOR DISPLAY ON MONITORS & IN PRINTS -\nIf your monitor is not calibrated to display correctly, what you see on your screen and what is actually true for the print you receive may be different. We calibrate our monitors and carefully manage our design colors to give prints that are as accurate as possible. Images on monitors are shown through a back light, so even calibrated monitors will display colors slightly different than on printed objects. The material that the design is printed on will affect the color as well - such as fabric, metal, ceramic, wood, etc. Inks are transparent and will print bolder and more vibrant on white, white coated, or light color items. On darker items prints will be naturally more subdued due to the darker color of the item itself showing through.\n\nHAVE ANOTHER QUESTION?\nPlease feel free to contact me anytime!\n\nORDER CANCELLATIONS\nOrders are made to order and very often we begin parts of the process for production immediately after they are received, because of this we cannot accept cancellations. We appreciate your understanding.",
